      Value: |
        At Central Life Sciences, we pride ourselves on producing effective, environmentally conscious mosquito control. Our commitment towards reducing our environmental footprint is reflected in our product lineup of mosquito control solutions, including <a href="~/link.aspx?_id=D2C5D8FC78724EAEAECBFE55650B7B3D&amp;_z=z">Altosid<sup>®</sup>&nbsp;larvicides</a>, <a href="~/link.aspx?_id=DD6911F8D2C24FD6A6A265EE89F4D654&amp;_z=z">Zenivex<sup>®</sup>&nbsp;reduced-risk adulticides</a>,&nbsp;<a href="~/link.aspx?_id=9214AF12C66944B495BECE4D09CFCD7F&amp;_z=z">FourStar<sup>®</sup>&nbsp;microbial larvicides</a>, and <a href="~/link.aspx?_id=BDD96D03EBE24573A3D18755167DB968&amp;_z=z">Duplex™-G&nbsp;larvicide</a>. To build upon our goal of protecting public health with a commitment to environmental compatibility, we are proud to offer customers savings with these rebate programs.<br />
